#include "../prekey_messages.h"

void test_deserialize_prekey_success_message(void) {
  const char *prekey_success_msg =
      "AAQGbQJzmFMujbgWDP1BjPZbsEO61+"
      "AmGPalm6QFnGugNXodeVM3MXxnMaWaLSxRkTfTPF3b+IDnuaOgnKIt8ckRvrjseEA=.";

  size_t len = strlen(prekey_success_msg);
  uint8_t *decoded = NULL;
  size_t decoded_len = 0;

  decoded = malloc(((len - 1 + 3) / 4) * 3);
  decoded_len = otrl_base64_decode(decoded, prekey_success_msg, len - 1);

  otrng_assert(decoded_len == OTRNG_PREKEY_SUCCESS_MSG_LEN);

  otrng_prekey_success_message_p dst;
  otrng_assert_is_success(
      otrng_prekey_success_message_deserialize(dst, decoded, decoded_len));

  uint8_t expected_success_mac[HASH_BYTES] = {
      0x53, 0x2e, 0x8d, 0xb8, 0x16, 0x0c, 0xfd, 0x41, 0x8c, 0xf6, 0x5b,
      0xb0, 0x43, 0xba, 0xd7, 0xe0, 0x26, 0x18, 0xf6, 0xa5, 0x9b, 0xa4,
      0x05, 0x9c, 0x6b, 0xa0, 0x35, 0x7a, 0x1d, 0x79, 0x53, 0x37, 0x31,
      0x7c, 0x67, 0x31, 0xa5, 0x9a, 0x2d, 0x2c, 0x51, 0x91, 0x37, 0xd3,
      0x3c, 0x5d, 0xdb, 0xf8, 0x80, 0xe7, 0xb9, 0xa3, 0xa0, 0x9c, 0xa2,
      0x2d, 0xf1, 0xc9, 0x11, 0xbe, 0xb8, 0xec, 0x78, 0x40,
  };

  otrng_assert_cmpmem(dst->success_mac, expected_success_mac, HASH_BYTES);

  free(decoded);
}

void test_deserialize_prekey_dake3_message(void) {
  const char *dake3_msg = ".";
  size_t len = strlen(dake3_msg);
  uint8_t *decoded = NULL;
  size_t decoded_len = 0;

  decoded = malloc(((len - 1 + 3) / 4) * 3);
  decoded_len = otrl_base64_decode(decoded, dake3_msg, len - 1);

  otrng_prekey_dake3_message_p dst;
  dst->message_len = 0;
  dst->message = NULL;

  otrng_assert_is_success(
      otrng_prekey_dake3_message_deserialize(dst, decoded, decoded_len));

  otrng_prekey_publication_message_p dst_1;
  otrng_assert_is_success(
      otrng_prekey_publication_message_deserialize(dst_1, dst->message, dst->message_len));

  for (int i = 0; i < dst_1->num_prekey_messages; i++) {
    otrng_dake_prekey_message_free(dst_1->prekey_messages[i]);
  }
  free(dst_1->client_profile);
  free(dst_1->prekey_profile);
  free(decoded);
}
